import React, { useState } from 'react';

// --- Sticker images (embedded from your Imgur gallery) ---
const BEAR_IMG = "data:image/png;base64,";
const ROSE_IMG = "data:image/png;base64,";
const CROWN_IMG = "data:image/png;base64,";

const StickerImg = ({ src, alt, style = {}, animDelay = "0s" }) => (
  <img
    src={src}
    alt={alt}
    style={{
      width: '160px',
      height: '160px',
      objectFit: 'contain',
      animation: 'float 3s ease-in-out infinite',
      animationDelay: animDelay,
      ...style
    }}
  />
);

// Crying face SVG (shown after 5 No clicks)
const CryingSticker = () => (
  <svg width="160" height="160" viewBox="0 0 200 200" style={{ animation: 'float 3s ease-in-out infinite', animationDelay: '0.3s' }}>
    <circle cx="100" cy="100" r="70" fill="#FFE5B4" />
    <circle cx="75" cy="90" r="8" fill="#333" />
    <circle cx="125" cy="90" r="8" fill="#333" />
    <path d="M 65 85 Q 75 80 85 85" stroke="#333" strokeWidth="4" fill="none" strokeLinecap="round" />
    <path d="M 115 85 Q 125 80 135 85" stroke="#333" strokeWidth="4" fill="none" strokeLinecap="round" />
    <ellipse cx="65" cy="100" rx="6" ry="12" fill="#87CEEB" opacity="0.8" />
    <ellipse cx="65" cy="120" rx="5" ry="8" fill="#87CEEB" opacity="0.6" />
    <ellipse cx="135" cy="100" rx="6" ry="12" fill="#87CEEB" opacity="0.8" />
    <ellipse cx="135" cy="120" rx="5" ry="8" fill="#87CEEB" opacity="0.6" />
    <path d="M 75 125 Q 100 115 125 125" stroke="#333" strokeWidth="4" fill="none" strokeLinecap="round" />
    <circle cx="55" cy="110" r="12" fill="#FFB6D9" opacity="0.5" />
    <circle cx="145" cy="110" r="12" fill="#FFB6D9" opacity="0.5" />
  </svg>
);

// Begging face SVG (shown after 11 No clicks)
const BeggingSticker = () => (
  <svg width="160" height="160" viewBox="0 0 200 200" style={{ animation: 'float 3s ease-in-out infinite', animationDelay: '0.3s' }}>
    <circle cx="100" cy="90" r="60" fill="#FFDAB9" />
    <circle cx="80" cy="85" r="12" fill="#333" />
    <circle cx="120" cy="85" r="12" fill="#333" />
    <circle cx="78" cy="82" r="4" fill="#FFF" />
    <circle cx="118" cy="82" r="4" fill="#FFF" />
    <path d="M 65 70 Q 75 65 85 70" stroke="#333" strokeWidth="3" fill="none" strokeLinecap="round" />
    <path d="M 115 70 Q 125 65 135 70" stroke="#333" strokeWidth="3" fill="none" strokeLinecap="round" />
    <ellipse cx="100" cy="105" rx="8" ry="6" fill="#333" />
    <ellipse cx="100" cy="140" rx="35" ry="25" fill="#FFDAB9" />
    <path d="M 85 140 L 100 130 L 115 140" stroke="#333" strokeWidth="3" fill="none" strokeLinecap="round" />
    <circle cx="90" cy="145" r="8" fill="#FFDAB9" />
    <circle cx="110" cy="145" r="8" fill="#FFDAB9" />
    <circle cx="60" cy="95" r="10" fill="#FFB6D9" opacity="0.6" />
    <circle cx="140" cy="95" r="10" fill="#FFB6D9" opacity="0.6" />
    <text x="55" y="75" fontSize="20" fill="#FFD700"></text>
    <text x="135" y="75" fontSize="20" fill="#FFD700"></text>
  </svg>
);

// Success bears (Bubu & Dudu style)
const BubuDuduSticker = ({ delay = 0, color = "brown" }) => (
  <svg width="200" height="200" viewBox="0 0 200 200" style={{ animation: 'bounce 1s ease-in-out infinite', animationDelay: `${delay}s` }}>
    <ellipse cx="100" cy="130" rx="50" ry="45" fill={color === "brown" ? "#C19A6B" : "#F5F5F5"} />
    <circle cx="100" cy="80" r="45" fill={color === "brown" ? "#C19A6B" : "#F5F5F5"} />
    <circle cx="70" cy="50" r="18" fill={color === "brown" ? "#C19A6B" : "#F5F5F5"} />
    <circle cx="70" cy="50" r="10" fill={color === "brown" ? "#A67C52" : "#E0E0E0"} />
    <circle cx="130" cy="50" r="18" fill={color === "brown" ? "#C19A6B" : "#F5F5F5"} />
    <circle cx="130" cy="50" r="10" fill={color === "brown" ? "#A67C52" : "#E0E0E0"} />
    <ellipse cx="100" cy="85" rx="35" ry="30" fill={color === "brown" ? "#E8C5A0" : "#FFFFFF"} />
    <path d="M 80 75 Q 85 70 90 75" stroke="#000" strokeWidth="4" fill="none" strokeLinecap="round" />
    <path d="M 110 75 Q 115 70 120 75" stroke="#000" strokeWidth="4" fill="none" strokeLinecap="round" />
    <circle cx="65" cy="88" r="8" fill="#FFB6D9" opacity="0.7" />
    <circle cx="135" cy="88" r="8" fill="#FFB6D9" opacity="0.7" />
    <ellipse cx="100" cy="95" rx="6" ry="5" fill="#000" />
    <path d="M 85 100 Q 100 108 115 100" stroke="#000" strokeWidth="3" fill="none" strokeLinecap="round" />
    <ellipse cx="60" cy="120" rx="15" ry="25" fill={color === "brown" ? "#C19A6B" : "#F5F5F5"} transform="rotate(-20 60 120)" />
    <ellipse cx="140" cy="120" rx="15" ry="25" fill={color === "brown" ? "#C19A6B" : "#F5F5F5"} transform="rotate(20 140 120)" />
    <path d="M 100 140 L 75 125 Q 70 120 70 112 Q 70 100 80 95 Q 90 92 100 100 Q 110 92 120 95 Q 130 100 130 112 Q 130 120 125 125 Z" fill="#FF69B4" stroke="#FF1493" strokeWidth="2" />
    <ellipse cx="90" cy="108" rx="8" ry="6" fill="#FFB6D9" opacity="0.6" />
    <text x="40" y="70" fontSize="18" fill="#FF69B4"></text>
    <text x="150" y="60" fontSize="18" fill="#FF69B4"></text>
  </svg>
);

export default function App() {
  const [noCount, setNoCount] = useState(0);
  const [yesPressed, setYesPressed] = useState(false);
  const [noPosition, setNoPosition] = useState({ x: 0, y: 0 });

  const phrases = [
    "No",
    "Are you sure?",
    "Pookie please ",
    "Don't do this to me ",
    "You're breaking my heart ",
    "I'm gonna cry... ",
    "Think about it!",
    "Are you absolutely certain?",
    "This could be a mistake!",
    "Really??",
    "Pwease ",
    "I'll be sad...",
    "You can't say no!",
    "Give me a chance!",
    "Don't be like that ",
    "Please please please!",
    "I'm begging you!",
    "Just say yes!",
    "Come on!",
    "Why not? ",
    "PLEASE SAY YES!",
    "I won't stop asking!",
    "Never gonna give up!",
    "Say yes already! "
  ];

  const getNoButtonText = () => phrases[Math.min(noCount, phrases.length - 1)];

  const handleNoHover = () => {
    setNoCount(noCount + 1);
    const newX = Math.random() * (window.innerWidth - 300) - (window.innerWidth / 2 - 150);
    const newY = Math.random() * (window.innerHeight - 200) - (window.innerHeight / 2 - 100);
    setNoPosition({ x: newX, y: newY });
  };

  const getMiddleSticker = () => {
    if (noCount >= 11) return <BeggingSticker />;
    if (noCount >= 5) return <CryingSticker />;
    return <StickerImg src={ROSE_IMG} alt="rose" animDelay="0.5s" />;
  };

  if (yesPressed) {
    return (
      <div style={{
        minHeight: '100vh',
        background: '#ffc9d9',
        display: 'flex',
        flexDirection: 'column',
        alignItems: 'center',
        justifyContent: 'center',
        fontFamily: '"Quicksand", sans-serif',
        position: 'relative',
        overflow: 'hidden'
      }}>
        {[...Array(60)].map((_, i) => (
          <div key={i} style={{
            position: 'absolute',
            width: '12px',
            height: '12px',
            background: ['#ff6b9d', '#ffd93d', '#6bcf7f', '#4d9fff', '#ff8364', '#c780e8'][i % 6],
            left: `${Math.random() * 100}%`,
            top: '-10px',
            animation: `fall ${2 + Math.random() * 2}s linear infinite`,
            animationDelay: `${Math.random() * 3}s`,
            borderRadius: Math.random() > 0.5 ? '50%' : '2px',
            transform: `rotate(${Math.random() * 360}deg)`
          }} />
        ))}

        <style>{`
          @import url('https://fonts.googleapis.com/css2?family=Quicksand:wght@400;500;600;700&display=swap');
          @keyframes fall { to { transform: translateY(100vh) rotate(720deg); } }
          @keyframes bounce { 0%, 100% { transform: scale(1); } 50% { transform: scale(1.1); } }
          @keyframes float { 0%, 100% { transform: translateY(0px); } 50% { transform: translateY(-15px); } }
        `}</style>

        <div style={{ display: 'flex', gap: '40px', marginBottom: '30px', alignItems: 'center', justifyContent: 'center' }}>
          <BubuDuduSticker delay={0} color="brown" />
          <BubuDuduSticker delay={0.2} color="white" />
        </div>

        <h1 style={{ fontSize: '80px', fontWeight: '700', color: '#ff6b9d', margin: '20px 0', textAlign: 'center' }}>
           Yipee! 
        </h1>
        <h2 style={{ fontSize: '50px', fontWeight: '700', color: '#ff3d7f', margin: '10px 0', textAlign: 'center' }}>
          Good Boy! 
        </h2>
        <p style={{ fontSize: '28px', color: '#ff3d7f', fontWeight: '600' }}>
          I'm so happy! 
        </p>
      </div>
    );
  }

  return (
    <div style={{
      minHeight: '100vh',
      background: '#ffc9d9',
      display: 'flex',
      flexDirection: 'column',
      alignItems: 'center',
      justifyContent: 'center',
      fontFamily: '"Quicksand", sans-serif',
      padding: '20px'
    }}>
      <style>{`
        @import url('https://fonts.googleapis.com/css2?family=Quicksand:wght@400;500;600;700&display=swap');
        @keyframes float { 0%, 100% { transform: translateY(0px); } 50% { transform: translateY(-15px); } }
        .yes-btn { transition: all 0.2s; }
        .yes-btn:hover { transform: scale(1.05); }
        .yes-btn:active { transform: scale(0.95); }
        .no-btn { transition: all 0.3s cubic-bezier(0.68, -0.55, 0.265, 1.55); }
      `}</style>

      <h1 style={{
        fontSize: '60px',
        fontWeight: '700',
        color: '#ff6b9d',
        marginBottom: '20px',
        textAlign: 'center',
        lineHeight: '1.2'
      }}>
         Will you be my Valentine? 
      </h1>

      <div style={{ display: 'flex', gap: '20px', margin: '30px 0', alignItems: 'center', justifyContent: 'center' }}>
        <StickerImg src={BEAR_IMG} alt="bear" animDelay="0s" />
        {getMiddleSticker()}
        <StickerImg src={CROWN_IMG} alt="crown" animDelay="1s" />
      </div>

      <div style={{
        display: 'flex',
        gap: '20px',
        marginTop: '30px',
        flexWrap: 'wrap',
        justifyContent: 'center',
        position: 'relative',
        minHeight: '100px'
      }}>
        <button
          className="yes-btn"
          onClick={() => setYesPressed(true)}
          style={{
            backgroundColor: 'white',
            color: '#ff3d7f',
            border: '3px solid #ff3d7f',
            borderRadius: '30px',
            padding: `${15 + noCount * 4}px ${50 + noCount * 8}px`,
            fontSize: `${26 + noCount * 5}px`,
            fontWeight: '700',
            cursor: 'pointer',
            fontFamily: 'inherit',
            boxShadow: '0 4px 0 #ff3d7f',
            transition: 'all 0.3s ease'
          }}
        >
          Yes
        </button>

        {noCount < phrases.length ? (
          <button
            className="no-btn"
            onMouseEnter={handleNoHover}
            style={{
              backgroundColor: 'white',
              color: '#999',
              border: '3px solid #ddd',
              borderRadius: '30px',
              padding: '15px 50px',
              fontSize: Math.max(26 - noCount * 2, 12) + 'px',
              fontWeight: '700',
              cursor: 'pointer',
              fontFamily: 'inherit',
              boxShadow: '0 4px 0 #ddd',
              position: noCount > 0 ? 'fixed' : 'relative',
              left: noCount > 0 ? `calc(50% + ${noPosition.x}px)` : 'auto',
              top: noCount > 0 ? `calc(50% + ${noPosition.y}px)` : 'auto',
              transform: noCount > 0 ? 'translate(-50%, -50%)' : 'none',
              zIndex: 1000
            }}
          >
            {getNoButtonText()}
          </button>
        ) : null}
      </div>

      {noCount > 0 && noCount < phrases.length && (
        <p style={{ marginTop: '30px', fontSize: '24px', fontWeight: '600', color: '#ff3d7f', textAlign: 'center' }}>
          I know you want to say yes! 
        </p>
      )}

      {noCount >= phrases.length && (
        <p style={{ marginTop: '30px', fontSize: '32px', fontWeight: '700', color: '#ff3d7f', textAlign: 'center' }}>
          You have no choice now!! 
        </p>
      )}
    </div>
  );
}
